function formatSecondsAsTime(secs, format) {
    var hr = Math.trunc(secs / 3600);
    var min = Math.trunc((secs - (hr * 3600)) / 60);
    var sec = Math.trunc(secs - (hr * 3600) - (min * 60));

    if (min < 10) {
        min = "0" + min;
    }
    if (sec < 10) {
        sec = "0" + sec;
    }

    currentTi.innerHTML = min + ':' + sec;

}

function formatDuration(t) {
    var m = Math.trunc(t / 60)
    var s = Math.trunc(t % 60)
    while (isNaN(s)) {
        songDurati = '0:00'
    }
    if (s < 10) {
        songDurati.innerHTML = '0' + m + ':' + 0 + s;
    } else songDurati.innerHTML = '0' + m + ':' + s

}
